    function trackClick() {
        var link = params.ios;
        if (getMobileOperatingSystem() === 'Android')
            link = params.android;
        if (typeof mraid !== "undefined")
            mraid.open(link);
        else window.open(link);
    }

    function getMobileOperatingSystem() {
        var userAgent = navigator.userAgent || navigator.vendor || window["opera"];
        if (/windows phone/i.test(userAgent)) {
            return "Windows Phone";
        }
        if (/android/i.test(userAgent)) {
            return "Android";
        }
        if (/iPad|iPhone|iPod/.test(userAgent) && !window["MSStream"]) {
            return "iOS";
        }
        return "unknown";
    }

    function sizeChanged() {
        if (typeof game !== "undefined" && game) {
            game.sizeChanged();
        }
    }

    function getSize(from) {
        if (typeof mraid !== "undefined") {
            var size = mraid.getScreenSize();
            return {width: size.width, height: size.height};
        }
        var w = document.documentElement.clientWidth;
        var h = document.documentElement.clientHeight;
        if (w === h || w === 0 || h === 0) {
            w = window.innerWidth;
            h = window.innerHeight;
        }
        return {width: w, height: h};
    }

    function showAd() {
        if (typeof mraid !== "undefined") {
            mraid.removeEventListener('ready', showAd);
            mraid.addEventListener('viewableChange', trackViewableChange);
            mraid.addEventListener('sizeChange', sizeChanged);
        }
        window.onorientationchange = function () {
            sizeChanged();
        };
        window.onresize = function () {
            sizeChanged();
        };
        createGame();
    }

    function trackViewableChange(viewable) {
        if (typeof game !== "undefined" && game && game.sound) {
            if (viewable) {
                game.sound.mute = false;
            } else {
                game.sound.mute = true;
            }
        }
    }

    if (typeof mraid !== "undefined" && mraid.getState() === 'loading') {
        mraid.addEventListener('ready', showAd);
    } else {
        showAd();
    }
